import { Component } from "react";
import React from "react";
import "./TouchId.scss";

class TouchId extends Component {
  render() {
    let index = this.props.arr.findIndex(
      (elem) => elem.name === "Touch ID in keyboard"
    );
    return (
      <>
        <div className="adds">
          <div className="adds__title">TOUCH ID IN KEYBOARD:</div>
          <div className="adds__container">
            {this.props.arr[index].items.map((item) => {
              return (
                <div
                  className={`adds__box  ${
                    item.isActive ? " adds__box active" : ""
                  }`}
                  key={item.id}
                  id={item.id}
                  onClick={(e) => this.props.setTouch(e.target.id)}
                >
                  {item.value}
                </div>
              );
            })}
          </div>
        </div>
      </>
    );
  }
}

export default TouchId;
